records.addlTxt:
Defendant Jaquayo R Spears in court with attorney Daryl A Kastenson.  Defendant Jaquayo R Spears in custody.  
Jeremy R. Arn appeared for the State of Wisconsin.  
Deputy Court Clerk: dds.

Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.

COUNT 1:  The defendant was advised of his constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting.  
COUNT 2:  Pursuant to plea negotiations and on state's motion the Court orders Count 2 DISMISSED AND READ-IN for the purpose of sentencing in Count 1.

Sentencing proceeded.  Statements made by State, defense, and defendant. 
 
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of  3 1/2 YEARS, CONSECUTIVE to any other time being served with credit for 89 days.  The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 24 MONTHS.

The defendant IS eligible for the Challenge Incarceration Program and the Substance Abuse Program.  

The Court STAYED this sentence and placed the defendant on probation for a period of 3 YEARS with the following conditions.

CONDITIONS OF PROBATION/EXTENDED:
*Serve 3 months in the House of Correction with release to the day reporting center.  No Electronic Monitoring;
*Obtain AODA assessment and if necessary complete follow-up care/treatment;
*Absolute sobriety with random urine screens and breathalyzer tests;
*No illegal drug dealing or association with drug community (drug users/dealers/houses);
*Cooperate with all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*No operation of a motor vehicle without a valid drivers license;
*No contact with victim Juan V.;
*Obtain/maintain full time employment or full time school with part time employment;
*Participate in Cognitive Thinking program;
*Obtain High school diploma or GED or HSED;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;
*Pay all applicable mandatory surcharges, fees, assessments, and costs by the end of probation period- any remaining balance to convert to civil judgment;

The Court finds the state in compliance with the victim rights legislation.  The Court ordered restitution set at zero for Juan V.  If revoked, the Court ordered all financial obligations and restitution(if any) to be paid through collection of sums by the Department of Corrections from 25% of prison funds and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.  The state grants expungement contingent upon successful completion ov each and every term of probation.  Defendant is informed he may not possess and/or own any firearms.  Defendant is informed he may not vote in any election until his civil rights have been reinstated.  Appeal rights given. 
Filed;
